import React,{ useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { addToCart } from '../actions/cartActions';
import '../App.css';
function DepositPage(props){
    const puppyId = props.match.params.id;
    const dispatch = useDispatch();

    useEffect(() => {
        if(puppyId){
            dispatch(addToCart(puppyId));
        }
    }, []);

    return <div className="PageContainer">
        <div className="Page">
        <h1> Deposits </h1>
        <div className="Intro">
            <div id="Title">

        </div>


        <p id="Title">Deposit</p>
        <p>
        I accept many forms of payment for deposits. 
        <br />
        <br />
        I  curently accept venmo as my only form of debit, credit cards type payment.
        <br />
        <br />
        I will be adding a direct way to pay with most major debit and credit cards soon.
        <br />
        <br />
        Walmart to walmart money transfer has been used in the past and has worked out great!
        For the techy type of payments i will accept BitCoin and Etherium wallet links below for both.
        </p>
        </div>
        </div>
        <div className="PageSum">
    <div id="Title"> Example Summary</div>
    <p>
        Thank in your interest in Home Raised Cairns.
        <br />
        HRC: SiteMap 
        <br />
    </p>
    </div>
    </div>
}
export default DepositPage;
